insert  into `article`(`id`,`slug`,`title`,`body`,`category_id`,`author_id`,`updater_id`,`status`,`published_at`,`created_at`,`updated_at`,`thumbnail_base_url`,`thumbnail_path`) values (1,'anh-gia-samsung-galaxy-s6-edge-thiet-ke-ep-hieu-nang-tot-pin-trung-binh','Đánh giá Samsung Galaxy S6 Edge: Thiết kế đẹp, hiệu năng tốt, pin trung bình','<p><img src=\"https://photo.tinhte.vn/store/2015/04/3027982_TINHTE.VN-S6-EDGE.jpg\" alt=\"TINHTE.VN-S6-EDGE.\"></p>Sự ra đời của <a href=\"https://www.tinhte.vn/tags/galaxy+s6+edge/\" class=\"Tinhte_XenTag_TagLink\" target=\"_blank\">Galaxy S6 Edge</a> dẹp bỏ mọi câu nói \"copy kiểu dáng qua các thời kỳ” mỗi khi chúng ta nói về điện thoại mới của <a href=\"https://www.tinhte.vn/tags/samsung/\" class=\"Tinhte_XenTag_TagLink\" target=\"_blank\">Samsung</a>. Với màn hình được làm cong hai bên, S6 Edge đã được đưa lên một vị thế hoàn toàn mới, không chỉ vì đó là một chiếc máy flagship mà còn bởi đây là chiếc điện thoại đầu tiên trên thế giới có màn hình cong hai bên mép nhiều đến như vậy. Ngoài ra, cảm biến vân tay ở nút Home được nâng cấp cho phép đọc vân tay không cần vuốt và khởi động camera cực nhanh bằng cách bấm đúp cũng là hai yếu cực kỳ đáng giá trên một chiếc điện thoại.<p><br><br></p><p><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/dcfRZvazqTE?wmode=opaque\" frameborder=\"0\" allowfullscreen=\"\" style=\"max-width: 100%;\"></iframe></p><br><b>Thiết kế<br></b><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027990_tinhte.vn-galaxy-s6-edge-8.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-8.\"></p>Hình dáng của điện thoại rất khó để thay đổi, do đó các hãng sẽ tập trung vào việc cách tân những thứ đang có sẵn, hoặc là thay đổi vật liệu chế tạo vỏ hoặc là biến đổi các chi tiết ở trên thân. Samsung đã thử cả hai, họ từng cố gắng làm mặt lưng giả da trên S5 và Note 4 nhưng không có nhiều thành công, có lẽ chính vì thế mà họ quyết định làm một thứ khó khăn hơn: bẻ cong màn hình.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027993_tinhte.vn-galaxy-s6-edge-11.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-11.\"></p>Galaxy S6 Edge rất đẹp, đây là sản phẩm đẹp nhất của Samsung từ trước đến nay, theo cảm nhận cá nhân của mình thì S6 Edge đẹp hơn hầu hết các loại điện thoại khác. Trong đó công lao lớn nhất đến từ yếu tố mép màn hình cong, đồng thời trang bị luôn khung viền bằng kim loại và mặt lưng bằng kính cường lực (Gorilla Glass 4).<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027988_tinhte.vn-galaxy-s6-edge-6.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-6.\"></p>Màn hình của S6 Edge cong tương tự như Galaxy Note Edge, nó không giống kiểu cong nguyên thân máy từ trên xuống giống như LG G Flex hay cong ngang như Galaxy Round (nói thiệt ai lại đi thích một chiếc máy méo mó như kiểu vừa mới bị đít ngồi lên chứ). Thay vào đó S6 Edge chỉ làm cong hai bên mép, thân máy vẫn phẳng, màn hình vẫn thẳng, chỉ có hai mép ngoài là cong xuống nửa thân máy. Kiểu làm này không những giúp cho máy đẹp hơn, nâng cao tính thẩm mỹ mà còn giúp bổ sung thêm khả năng hiển thị cho điện thoại vì Samsung có thể dùng phần diện tích cong này để biến nó thành một cái màn hình phụ, giống như một cái màn hình thứ hai nằm ở cạnh bên của máy, dùng để hiện những thứ linh tinh như đồng hồ, ngày tháng, thông báo cuộc gọi nhỡ hay tin nhắn… Do đó mình rất thích kiểu màn hình cong của S6 Edge, nó làm cho máy đẹp hơn, cảm giác sử dụng về cơ bản vẫn giữ nguyên và bổ sung thêm nhiều tiện ích nhỏ thú vị khác.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027991_tinhte.vn-galaxy-s6-edge-9.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-9.\"></p>Khung máy năm nay đã được làm bằng kim loại thật 100%, không còn chơi kiểu nhựa xi cho giống kim loại như mọi năm. Chất lượng hoàn thiện khung của S6 Edge rất đẹp và tốt không thua kém sản phẩm của HTC hay Apple, thể hiện rất sắc sảo ở các chi tiết như nét cắt hai mép trên và dưới của khung, các lỗ loa ngoài, cổng kết nối và khe SIM. Khung máy to ở hai cạnh trên/dưới, sau đó thu nhỏ dần ra hai bên cạnh trái và phải để nhường chỗ cho màn hình cong xuống. Ở đây có một điểm khá đẹp đó là bốn góc của khung, chỗ thay đổi từ dày thành mỏng, đường cong uốn lượn đều và nhẹ nhàng. Thêm nữa là nó còn làm cho chúng ta có cảm giác máy mỏng đi đáng kể.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027983_tinhte.vn-galaxy-s6-edge-1.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-1.\"></p>Đến mặt lưng, năm nay Samsung chơi hẳn một tấm kính cường lực Gorilla Glass 4 bao phủ gần như toàn bộ mặt lưng nên cũng phần nào làm chúng ta yên tâm hơn về độ bền. Mình đã thử bỏ máy vào túi quần Jean phía sau rồi ngồi lên ghế nệm, máy vẫn bình an (thở phào nhẹ nhõm, hồi xưa làm tương tự với con Xperia Z3 &gt; nứt tan tành). Tuy nhiên mình không khuyến khích các bạn làm điều này, nhất là những ai mặc quần skinny hoặc quần bó. Nói thêm S6 Edge là chiếc điện thoại đầu tiên của Samsung khiến mình cảm thấy rất tự tin khi cầm trên tay hoặc chìa mặt lưng ra, không phải vì nó có logo Samsung, không phải vì mình chảnh chóa nhưng mà là vì mặt lưng nó đẹp. Máy của mình màu Trắng (mà theo mình là đẹp nhất trong tất cả các màu vì không quá bóng bẩy như màu Vàng hay Xanh) khi kết hợp với những chiếc quần Jean thì trở nên nổi bật hơn hẳn, nhìn rất sang trọng và sáng sủa. Phần mặt lưng có camera lồi hơn hẳn, mình thấy nó không có vấn đề gì cả thậm chí còn có tác dụng bảo vệ toàn bộ mặt lưng khỏi bị trầy.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027984_tinhte.vn-galaxy-s6-edge-2.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-2.\"></p>S6 Edge có thiết kế đẹp, màn hình cong đẹp, mặt lưng đẹp nhưng còn chất lượng hoàn thiện thì sao? Điều này rất quan trọng bởi vì S6 Edge mắc hơn S6 thường tới hơn 3 triệu đồng. S6 Edge được cái đẹp hơn S6 thường nhưng bạn phải chấp nhận hai nhược điểm sau đây:<ul><li><b>Máy cấn hơn:</b> Cầm trên tay thấy cấn nhiều, chủ yếu là hai cạnh bên vì chúng nhô ra ngoài nhiều hơn màn hình một khoảng đáng kể. Khi bạn vuốt từ trên màn hình cong xuống tới khung, bạn cũng thấy cấn vì cái khung lòi ra.</li><li><b>Hở màn hình:</b> bốn góc chỗ tiếp giáp giữa màn hình với khung, bạn sẽ thấy rất rõ các khe hở.</li></ul><ul><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028010_tinhte.vn-galaxy-s6-edge-26.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_T_ciCIKWR_haFCWbB4tv_RntGFJSCiSJHhG082pkovz1xXZcFhx_XUzF1ANeFfGTvL4LoCbSsNfWAGq9gakJk\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028011_tinhte.vn-galaxy-s6-edge-27.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_iDJAqsaOH3vp18b0KhAj3Vw07Wq-mmlY912s_8Ib2VIKmOzNsABWFuqi7_E3-kDSQmmB-wo9SJCsMaUQZIf-5\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028012_tinhte.vn-galaxy-s6-edge-28.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8g_P5smlMUumMV9qZVGshKOVKwZHEW9OsxIC7Ep9FpXczwWj95BOQHIdHYSoXcSpjmCr5hEBoGSMi1HsBjUu3O\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028013_tinhte.vn-galaxy-s6-edge-29.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_jnilGz_20Ir5ek-svvUIKdqxKS9Z89acV8FH00Sh3j4MUxt6N6It4BNvKldjb3EdNFi3Ff2oIUEdA-xfBxk5l\"></a></li></ul><br>Đó là 2 nhược điểm duy nhất và lớn nhất trong thiết kế của S6 Edge, tóm lại mà nói thì khả năng hoàn thiện sản phẩm của Samsung vẫn còn kém chứ chưa có đột phá nhiều. Mặc dù có tiến bộ về thiết kế màn hình nhưng về cảm giác cầm-nắm-sờ soạng máy mỗi ngày mà nói thì chưa thật sự tốt. Ví dụ mình có thể cầm One M9 hoặc iPhone 6 cả ngày mà không thấy khó chịu, nhưng cầm S6 Edge thì luôn bị cái vụ cấn làm cho không thoải mái, nhưng mà thực tế vẫn khoái cầm lên để khoe cái mặt lưng <img src=\"https://www.tinhte.vn/styles/default/xenforo/clear.png\" alt=\":D\"><p><br><br></p><ul><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027985_tinhte.vn-galaxy-s6-edge-3.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-cSgG675u-ZdjH46rsXgiXg_NOrTDfgvrH8C6RQHtVw1guYfuupuDiHtpa91teHEcNVIZ5YWVxKOxeZTYfYath\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027986_tinhte.vn-galaxy-s6-edge-4.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-bBhS5BTiHUYdkNaEPFlQ23L6SWEe5YdTI8YvNq4e9hK63n9FZSbzzL9-o1EOpI0sqWr9xF6AcmTSjfGVKvfNn\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027987_tinhte.vn-galaxy-s6-edge-5.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9ZSzvJ5pfRWcQGt-IQEP2tuVEjOYUKPsrT8U5z-30Oh_vJHTMtPrINocDmoBOg8GZXK0AUz8DgVUfRF5m5yJM8\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027989_tinhte.vn-galaxy-s6-edge-7.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_vJg1kU_GKqj2vyJkpFqxDTInH9l9-SGV4FTyuD_709V6k5TT_VH8MT9cSYmHflnZrMMDnKqaa3ZbYSdDF84W1\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027992_tinhte.vn-galaxy-s6-edge-10.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8uN2D3DLOQ4eW6xe0JmR3Bd39i7ByFLtXEeHNx4W5mCDFXuAbFFZqJlf3LT5nhmnAQzgR6o66xBCpgbT_pWmLx\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027994_tinhte.vn-galaxy-s6-edge-12.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8NV2LTjMA91w1Qzd59VM_0vtNTXxK26Tr5fZjgI_3U8bB2fhdwrE9CY3P9IPREpooN4VmbHkGeYnzXoPJpIDyu\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027995_tinhte.vn-galaxy-s6-edge-13.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_PNSE8c4c2e3LtZhmfaufbG9z7coi0FKTOFpYz8vT6HYCff0QETWD8zn1ufdt2tqQlS_VE6ALvHIozOGEfDiMu\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027996_tinhte.vn-galaxy-s6-edge-14.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-vsZ5TSY95B12CRZ3DjhVPJ_OivVwKQo4MOA4Vf0VH9Ef8LK8HvA7B0xc77kazEEgYfFJEC_Bjz3qcSFtudMrf\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027998_tinhte.vn-galaxy-s6-edge-16.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-dIYVMgnoajrUYtYUvTSY534ig3nN9w-Pl1fbpeqw0pu201Lh0z7H8Pl3HPl65SUnscqzAiZ_oim55GHjAD9g_\"></a></li></ul><p><br><br><b>Màn hình</b></p><p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028006_tinhte.vn-galaxy-s6-edge-22.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-22.\"></p>S6 Edge dùng màn hình Super AMOLED, kích thước 5,1” độ phân giải 2K (2560 x 1440), chia ra được mật độ điểm ảnh bằng 577 ppi, một con số rất cao. Hiện nay không có nhiều lý do để chúng ta phải bàn cãi về sự khác biệt giữa màn Super AMOLED với màn IPS, giữa đẹp và xấu, rổ hay không rổ vì thực tế nó tùy thuộc vào mức độ sử dụng của mỗi bạn đang ở mức nào.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028008_tinhte.vn-galaxy-s6-edge-24.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-24.\"></p>Ví dụ như bản thân mình đang xài iPhone 6 Plus (màn IPS), khi chuyển sang S6 Edge mình cảm thấy rất hạnh phúc ở chỗ xem hình chụp rất đẹp và trong trẻo, ảnh lúc nào cũng sáng sủa và sắc nét. Những tấm chụp trắng đen còn ảo diệu hơn do màn Super AMOLED có khả năng hiển thị màu đen đẹp tuyệt đối, hơn hẳn màn IPS của iPhone. Tuy nhiên niềm hạnh phúc đó dừng lại đúng ở chỗ xem và trải nghiệm trên chính máy S6 Edge. Còn nếu mình muốn làm xa hơn nữa ví dụ như chỉnh sửa màu cho ảnh, thêm hiệu ứng filter này kia hoặc cơ bản nhất là chỉnh cho về đúng màu sắc thực tế của ảnh thì mình sẽ dùng iPhone, dùng iPhone để chụp hoặc là gửi ảnh sang iPhone để làm vì màu của màn IPS chính xác hơn. Nói như vậy để các bạn hiểu rõ về ưu nhược điểm của mỗi loại màn hình.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028009_tinhte.vn-galaxy-s6-edge-25.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-25.\"></p>Vậy màn của S6 Edge đẹp hay xấu? Theo thống kê không chính xác và chủ quan của mình thì 80% người xem sẽ nói đẹp. Hình ảnh đủ sáng, sắc nét, màu sắc rực rỡ và tươi tắn thì làm sao nói xấu được chứ. Đại đa số người dùng thông thường sẽ muốn có một màn hình như thế và chấp nhận vẻ đẹp này. Còn đối với những người ưu tiên mức độ chính xác của màu ảnh thì sẽ cho rằng màn hình S6 Edge không đẹp vì nó sai với thực tế (thực ra là do bản chất của Super AMOLED). Samsung chọn màn hình Super AMOLED đồng nghĩa với việc chọn làm máy cho số đông chứ không làm máy cho số ít (tức nhóm người dùng cao cấp, có yêu cầu cao về mặt hình ảnh). Chiến lược này thực tế rất thành công vì nó ăn sâu vào tiềm thức của đại đa số người đi mua điện thoại: chọn Samsung vì nó có màn hình đẹp.<p><br><br>Còn so sánh kỹ hơn một chút, đặt cạnh một màn IPS khác sẽ thấy màn hình của S6 Edge đậm đà hơn ở đa số các mảng màu, màu đỏ thì đỏ hơn, màu xanh da trời cũng xanh hơn, màu đen tuy đẹp nhưng màu trắng lại không trắng tinh được như bên IPS. Nó làm cho mình khó chịu ở chỗ làm sai lệch đi toàn bộ các tông màu mà mình đã cố gắng chỉnh cho bằng được sau khi chụp ảnh, ví dụ như một tấm hình chụp có biển và có bầu trời xanh, mình thích dùng filter để cho nó về tông màu nhạt hơn, nhìn \"tây\" hơn thì khi xem trên S6 Edge (và nhiều máy Super AMOLED khác), bức hình trở nên quá đỗi bình thường, màu sắc lòe loẹt, làm mất đi bản chất ban đầu của tấm hình đó. Đây chỉ là một vấn đề điển hình rất thường gặp đối với những ai làm việc nhiều với hình ảnh và camera, khi mà ưu tiên về độ chính xác của màu sắc được đưa lên mức độ cao nhất thì việc sử dụng một chiếc máy có màn hình chính xác là rất quan trọng. Nhìn chung mà nói, màn hình của S6 Edge không có đột phá về khả năng hiển thị, ngoài việc nó cong ra thì không có công nghệ nào khác so với những máy đầu bảng trước đó của Samsung ví dụ như S5 hay Note 4. Nếu bạn mong đợi màn hình của S6 Edge ưu việt hơn các máy trước đó thì không đâu, không có công nghệ gì mới cả. Nhưng tin vui là nhờ có màn hình cong mà cảm giác nhìn sẽ có đôi phần khá hứng thú.</p><p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028007_tinhte.vn-galaxy-s6-edge-23.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-23.\"></p>Ví dụ, nhờ có mép cong phản chiếu ánh sáng đi tới mà nhìn màn hình lúc nào cũng bóng bẩy, có \"nét\" hơn. Thứ hai là khi chúng ta vuốt ngang xem ảnh hoặc vuốt trang web, bạn sẽ thấy chữ và hình ảnh bị \"nuốt\" vào hai cái mép cong rất thú vị, tạo cảm giác nổi 3D trên toàn bộ các trang web hoặc hình ảnh mà chúng ta đang xem chứ không đơn thuần là xem ảnh 2D. Thêm một tác dụng nữa là dùng làm... thanh cuộn. Thông thường để cuộn trang web, chúng ta hay vuốt ngón tay lên chính giữa màn hình, còn với S6 Edge thì ta có thể vuốt ở bên cạnh của thân máy, chỗ màn hình cong nhưng vẫn còn khả năng cảm ứng. Như vậy ngón tay ta có thể cuộn mà không che đi một phần nội dung đang hiển thị.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028000_tinhte.vn-galaxy-s6-edge-19.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-19.\"></p>Ngoài những cái mình vừa kể, màn hình cong của S6 Edge còn được dùng để:<ul><li>Hiển thị ngày giờ: mình đặt chế độ hiển thị từ 9 giờ tối đến 6 giờ sáng, trong khoảng thời gian này thì bên cạnh phải màn hình sẽ hiện ra một dòng đồng hồ nhỏ, rất tiện lợi để xem trong đêm hoặc dùng làm đồng hồ trong phòng ngủ.</li><li>Khi úp máy xuống bàn, viền cong sẽ sáng lên khi có người gọi đến hoặc có thông báo Notification.</li><li>Khi ở màn hình khóa hoặc Home, vuốt từ cạnh phải sang để xem danh sách các danh bạ hay liên lạc (phải cài trước), tối đa 5 người, mỗi người một màu. Khi úp máy xuống có người trong danh sách này gọi đến hay nhắn tin thì màu tương ứng sẽ sáng lên.</li><li>Hiện thông tin các loại (cái này hay nhất): Khi màn hình đang tắt, vuốt qua vuốt lại hai cái lên viền bên phải thì các thông tin sẽ hiện ra ví dụ như thông báo Notification, ngày giờ, thời tiết, tin tức, chứng khoán, tỷ số trận đấu… sau khi nó hiện ra, bạn có thể vuốt lên/xuống để chuyển giữa các nội dung đó.</li></ul><ul><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028014_tinhte.vn-galaxy-s6-edge-17.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_94Jh1wWlciz7hZ4x8quKqsySPXX1uV-7GFDj9u2HjRoH_GrTtA3UDCoLKiBUklA6iEYFh2UdUBqUfrj_SN2mo\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3027999_tinhte.vn-galaxy-s6-edge-18.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8AYQOUTSiXBB1PYolDK86eJ-c0Fm0O9say3ABviQG1o-5AprmxOaXbC66ZrJP_NaGWE56iWE0wn6ebq5rDSbDO\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028001_tinhte.vn-galaxy-s6-edge-20.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_g-CyLBXW45E8evRyXusgSXwmedI1os-l8XUnns0a9EbWlfDIp-VY8rH0P7_Hm7f81EogAqATFA0lc2ch8qjDC\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028004_tinhte.vn-galaxy-s6-edge-21.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_1U7iPyXVM9D94VZv_Ctes9ZmbXBKsV6SkVZTWvKb07du6As-56YkkmJE8kuClNcYsCgTWHw00eXx0ToL8VQ6B\"></a></li></ul><br>Câu hỏi sau cùng: Có đáng để mua màn hình cong của S6 Edge không vì nó mắc hơn S6 thường tới hơn 3 triệu? Thật sự mình thấy chỉ nên mua nếu bạn yêu cái đẹp, màn hình cong của con Edge chủ yếu đẹp là chính, chứ dùng để làm các chức năng này kia như đã liệt kê này giờ thì không đủ sức thuyết phục cho lắm vì thực sự những trải nghiệm đó chưa thật sự tuyệt vời để ta có thể đắn đo về việc có hay không có.<p><br><br>Thêm cái nữa là chức năng Auto-Brightness (tự động canh sáng màn hình) hoạt động không chính xác. Ra trời nắng màn hình vẫn không tự động tăng độ sáng lên nên nhìn không thấy gì, làm mình nhiều lần phải tăng sáng bằng tay. Cái này có vẻ do lỗi phần mềm, máy S6 Edge của mình là máy chính thức, không phải máy test, trong quá trình sử dụng đã được update OTA một lần và đang chạy trên Android 5.0.2. Hy vọng sắp tới sẽ được sửa sớm.</p><p><br><br><b>Nút Home cảm biến vân tay</b><br>Nút Home trên S6 Edge là nút cứng, tích hợp cảm biến đọc vân tay, cảm biến này ngon hơn thời Galaxy S5 ở chỗ chỉ cần chạm ngón tay lên là nó đã đọc được rồi, không cần phải vuốt từ trên xuống nữa. Nhờ vậy mà tốc độ mở khóa nhanh hơn trước rất nhiều. Tốc độ quét vân tay có thể nói là ngang ngửa với cảm biến Touch ID trên các máy của Apple.</p><p><br><br>Sau khi thiết lập bảo mật vân tay, bạn có thể đặt ngón tay theo chiều nào cũng được, không cần phải đặt đúng vị trí như ban đầu. Sau cùng, nó cũng mắc phải một sơ sở tương tự như Touch ID của Apple đó là cho phép quét nhiều ngón ở bước thiết lập vân tay. Lúc thêm vân tay mới, tới bước quét ngón tay, nếu bạn quét nhiều ngón tay khác nhau thì sau này có thể dùng tất cả các ngón đó để mở khóa được hết.</p><p><br><br><b>Camera</b></p><p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3027997_tinhte.vn-galaxy-s6-edge-15.jpg\" alt=\"tinhte.vn-galaxy-s6-edge-15.\"></p>Yếu tố ăn điểm đầu tiên cần phải nói ngay: khởi động camera cực nhanh khi nhấn đúp phím Home, mọi lúc mọi nơi, kể cả khi đang tắt màn hình. Như vậy trong một số trường hợp có thể nói S6 Edge khởi động camera còn nhanh hơn cả iPhone. Nhờ có nó mà mình có thể chụp hình rất nhanh mọi khoảnh khắc chứ không phải thao tác rườm rà như các máy Android khác.<p><br><br>Tính năng Auto HDR theo thời gian thực hoạt động khá chuẩn xác và hữu ích mỗi khi chụp hình. Thông thường khi chụp HDR, bạn phải chụp xong thì mới thấy được hiệu ứng của nó, còn đối với HDR theo thời gian thực, bạn sẽ thấy được ngay hiệu ứng đó thể hiện trên màn hình của điện thoại. Nhờ vậy bạn sẽ thấy trước kết quả chụp và di chuyển khung hình sao cho vừa ý nhất mà không cần phải chờ chụp xong để coi.</p><p><br><br>Chất lượng ảnh chụp: rất đẹp khi xem trên màn hình của S6 Edge. Mỗi bức ảnh, từ đủ sáng cho đến thiếu sáng đều được thể hiện rất xuất sắc trên màn hình của máy. Hình chụp rất trong trẻo, sắc nét, đầy đủ chi tiết, no màu và không lòe loẹt. Đặc biệt ảnh chụp ban đêm rất tốt, mặc dù nhiều lúc bị sai cân bằng trắng hơi nhiều nhưng <a href=\"https://www.tinhte.vn/tags/%C4%91%C3%A1nh+gi%C3%A1/\" class=\"Tinhte_XenTag_TagLink\" target=\"_blank\">đánh giá</a> trên tổng quát thì khả năng chụp tối của S6 Edge rất đáng khen, tốc độ chụp nhanh cộng với tính năng chống rung quang học giúp cho hầu hết mọi bức ảnh trong nhà hay thiếu sáng đều rất sắc nét. Tuy nhiên khi đem hình lên máy tính để xem thì chất lượng không còn ngon như vậy nữa do hình ảnh kém trong hơn.</p><p><br><br>Một tính năng tuyệt vời khác của camera hoạt động rất tốt đó là AF Tracking, hay còn gọi là tự động theo dấu đối tượng lấy nét. Nó như thế này: Bạn chạm lên màn hình để lấy nét vào gương mặt của người ta, bây giờ người đó có di chuyển như thế nào trong khung hình thì khung lấy nét sẽ tự động di chuyển theo, bạn không cần phải chạm để lấy nét lại. Tính năng này đặc biệt hữu dụng để chụp ảnh thể thao hoặc các pha chuyển động nhanh ví dụ như đá banh, đá cầu hay đạp xe, bạn chỉ cần chạm một lần để lấy nét, từ đó về sau bạn chỉ phải lo bấm chụp mà thôi, không cần phải chạm nữa vì bây giờ máy sẽ liên tục lấy nét vào điểm mà bạn đã chọn ban đầu. Hoặc dùng để chụp con nít, con nít thường rất hiếu động và không dứng yên một chỗ, nếu có AF Tracking thì chỉ cần chạm một lần là máy sẽ liên tục lấy nét vào gương mặt của chúng, chấp con nít chạy lung tung luôn.</p><p><br><br></p><ul><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028040_tinhte.vn-s6edge-camera-1.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9IEKtzYMVRncbU4x9aTA4R6lfX63Xt0XtEkLjStz-BqcjuwkFNxdsFZ5l2T-KRnqzc4eqCthZNKGfyAzIfMKl2\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028041_tinhte.vn-s6edge-camera-3.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9G5gKchy1L6gUXCooPpSj7f41kYdH1nRENITFGr3N1Wvc0BbZsO52kFnHr0LXaWtshIKG3TIOvjeRbtYmhA-HJ\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028042_tinhte.vn-s6edge-camera-5.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-8TMu2K-CYmWaGput2jNQXUTTfMX39oWchedNy8Q9Bz0KyVPT8Tzoubl0zRnNQyyHnDALTqXaJ0G-XGDPQcrJw\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028043_tinhte.vn-s6edge-camera-6.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9cZQkn9lV_68qRJerYU_FkeiYqJHXvCO3-3yVs3mp310eBzkwGaq6mquS3sSbRLdLFTpM1JlsvlJQh2zAAolR-\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028044_tinhte.vn-s6edge-camera-7.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9WXN42SY3wKDjBI3DHQ06UGJj594jWPRmMqvVaM-JUWXLNbl5lKAdxrAgus7hEM3oOqEck8oYDmMNmJJhB0Mpr\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028045_tinhte.vn-s6edge-camera-8.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-bs9EocdB_b8m03nTBTqO6I8ffZU_Anw9GG-Ncp-n62FMb4oYmqXScXRDHdmjvQ-c3TVk3zQyxXiNF94ePvsAx\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028046_tinhte.vn-s6edge-camera-9.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD-ZNk2qY5cJbfQ_Xz1BE33A9BXXFPnfmKh24SL5FwFoNE8lBSJuOk2l_cxeU4g0vK0rrG_wXsbO0BehvCD8DJgi\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028047_tinhte.vn-s6edge-camera-11.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9VT1j6bOK7MhHGPkWoRsfVSqipXzzkkay8LAGr_WT3joSoMOSRs7M9MUFXFl1TRj9IVr08-bok6hakqwNOpbaa\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028048_tinhte.vn-s6edge-camera-12.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8Y_ZLKnRynTdLNgTjqC9OR5VFDtuzHqErTVg77ohKOQ4QBXLxoahKECQiCmZqEaTci72lJavYeuJPUf-SdX8WM\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028050_tinhte.vn-s6edge-camera-13.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9FSqz7YDFMDkK7zkOAazsFHt-COleDI9EE_mLfNtYh26V3EzUl6WNT6Ut3tdbl79aYry24itZI8ngqmqKtxRxI\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028051_tinhte.vn-s6edge-camera-14.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD_DtsIP6erkyhDiDwQ7j4n8Xw2D6yxUdXQopqB4Cs9CuYJIFw5yGj1n_wYNNRLrhsfFJIP-InRbDWo_vAeOy1K5\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028052_tinhte.vn-s6edge-camera-15.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9H6v9_Prko7BbLbzoko8FK3CVfGQ_jwd3jZeTFotQVdzpXhllSVzeXEa_vfKpUKXTFnQgAtXNzp9QypRCjdO-G\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028053_tinhte.vn-s6edge-camera-16.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD9ujHQdid9su8FtZJNHRJHDK2JldzNfb-h8NAhmaZGvhVtquxR9ArBILeqc52ItXjhLrV1U-2Jt28xnfAnT6KSH\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028054_tinhte.vn-s6edge-camera-2.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8hCrr-N9Qm05ixub-WKqWgX0XepmKJTDQkznJPW8cyvz2vMTqjQAPydFb8A_tIxBe4IFkc9Iviz5QyPOdvjNFR\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028055_tinhte.vn-s6edge-camera-4.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD92QN9zBEbs___Lw3FkXLJtVRTjb_frqFsbe2NDo05t4PFw_ovEIzUi131ketpfPvVvQoTl2o2r2bueqLdfP345\"></a></li><li><a href=\"https://photo.tinhte.vn/store/2015/04/3028056_tinhte.vn-s6edge-camera-10.jpg\" class=\"LbTrigger\" data-href=\"misc/lightbox\"><img src=\"https://1anh.com/145/EZYwYm5NdZIwlXo48tMBufykgNFiWK-L-tezFAefrD8WbLJ6ga3-humKc8Dkl3QR2RC6Sbhqf7jwPnB93ClzYtR5R_4ra0dF5JHz0ifjaZ-O2eD-U6NutUV7TEENyLHl\"></a></li></ul><p><br><br><b>Hiệu năng - Phần mềm</b><br>S6 Edge chạy trên Android 5.0.2, tốc độ nhanh và mượt nhiều hơn so với Android 4.4 và còn nhanh hơn cả Note 4 đã up lên Android 5.0. Trước đây giao diện TouchWiz của các máy Galaxy thường khá nặng nề và chậm dần theo thời gian sử dụng sau khi cài nhiều app. Nhưng trên 5.0 của S6 Edge thì mọi thứ đã được cải thiện, tốc độ phản hồi nhanh hơn, máy chạy mượt hơn, tuy không nhiều nhưng cũng rất đáng giá.</p><p><br><br>Một điểm mới nữa trên S6 Edge đó là tính năng thay đổi Themes (giao diện), bạn có thể thay đổi toàn bộ giao diện của máy dựa vào hàng chục hàng trăm Themes có sẵn trong kho ứng dụng dành cho Themes. Có lẽ như đây là một tính năng độc quyền trên S6 và S6 Edge vì chiếc Note 4 mình up lên 5.0 thì không thấy có (dùng ROM của nước Ba Lan).</p><p><br><br>Dưới đây là kết quả benchmark của Galaxy S6 Edge:</p><p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028067_TINHTE.VN-S6EDGE-BENCH-1.png\" alt=\"TINHTE.VN-S6EDGE-BENCH-1.\"><br><br><img src=\"https://photo.tinhte.vn/store/2015/04/3028066_TINHTE.VN-S6EDGE-BENCH-2.png\" alt=\"TINHTE.VN-S6EDGE-BENCH-2.\"></p><b>Pin</b><br>Pin của Galaxy S6 Edge onscreen ngót ngét được khoảng 3 tiếng, đạt mức trung bình mếu không muốn nói là hơi kém. Những ngày ngồi ở văn phòng, ít cầm máy lên nghịch thì đến chiều về cũng còn hơn 60% pin. Còn những hôm phải ra ngoài nhiều, dùng 3G là chính và phải thường xuyên mở máy lên làm đủ thứ việc thì pin chỉ trụ được đến tầm 3 giờ chiều là gần cạn. Sau nhiều tuần sử dụng thì mình thấy thời lượng onscreen của S6 Edge chỉ đạt khoảng 3 giờ, nếu dùng 3G nhiều thì có hôm chỉ được có 2,5 tiếng onscreen. Đây là một điểm đáng thất vọng của S6 Edge. Tuy nhiên do máy có công nghệ sạc nhanh nên lúc cần cũng có thể sạc lại trong thời gian rất ngắn (trung bình tầm 6 phút sạc được 10%). Để có một kết quả cụ thể và chuyên sâu hơn nữa thì chúng ta sẽ chờ bài test pin của nhóm test pin Tinh Tế nhé.<p><br><br></p><p><img src=\"https://photo.tinhte.vn/store/2015/04/3028033_tinhte.vn-s6edge-pin.jpg\" alt=\"tinhte.vn-s6edge-pin.\"></p><b>Kết luận</b><br>Galaxy S6 Edge là một bước tiến lớn của Samsung nhưng vẫn chưa đủ lớn để chúng ta bất chấp tất cả để có được một màn hình cong như thế, mặc dù có tiến bộ về thiết kế nhưng khả năng hoàn thiện sản phẩm của Samsung vẫn còn kém Sony, HTC hay Apple khá nhiều. Dĩ nhiên nếu bạn yêu thích cái đẹp thì khác biệt về giá so với Galaxy S6 sẽ không thành vấn đề. Còn nếu xét về yếu tố hiệu năng/giá thành thì thật sự Galaxy S6 đáng mua hơn (nếu bạn chỉ nhắm đến một trong hai máy này).<p><br><br><b>Ưu điểm</b><br></p><ul><li>Thiết kế đẹp, khung kim loại, máy nhẹ, mặt lưng đẹp.</li><li>Màn hình cong rất quyến rũ.</li><li>Màn hình cong có thể dùng làm màn hình phụ.</li><li>AF Tracking làm việc hiệu quả.</li><li>Hiệu năng rất tốt.</li><li>Cảm biến vân tay tuyệt vời.</li><li>Khởi động camera cực nhanh.</li></ul><b>Nhược điểm</b><ul><li>Khung viền cấn tay.</li><li>Pin trung bình.</li><li>Bị hở màn hình ở bốn góc của khung.</li></ul><b>Cấu hình Galaxy S6 Edge</b><ul><li><i>Hệ điều hành: Android 5.0</i></li><li><i>Chip xử lý: Exynos 7420, 64-bit, 14 nm, tám nhân (4 nhân 2.1 GHz + 4 nhân 1.5 GHz)</i></li><li><i>GPU: Mali-T760MP8</i></li><li><i>Màn hình: 5,1” Super AMOLED, độ phân giải 2K (1440 x 2560), 577 ppi, cong hai mép</i></li><li><i>Kính cường lực: Gorilla Glass 4 ở mặt trước và mặt sau</i></li><li><i>Nút Home có cảm biến vân tay</i></li><li><i>RAM: 3 GB LPDDR4</i></li><li><i>Bộ nhớ trong: 32 GB (UFS 2.0)</i></li><li><i>Thẻ nhớ: không có</i></li><li><i>Camera sau: 16 MP, AF, LED Flash, F1.9, quay phim 4K@30fps</i></li><li><i>Camera trước: 5 MP, F1.9</i></li><li><i>Kết nối: NFC (có thanh toán không cần chạm), Wi-Fi a/b/g/n/ac, BT 4.1 có aptX, cổng hồng ngoại, GPS, GLONASS, Beidou, 3.5mm</i></li><li><i>Băng tần: 4G Cat 6, 3G</i></li><li><i>Kích thước: 70,1 x 142,1 x 7 mm</i></li><li><i>Nặng: 132 gram</i></li><li><i>Pin: 2.600 mAh</i></li><li><i>Sạc không dây</i></li></ul>',1,1,1,1,1430352900,1430463895,1430901037,'http://storage.yii2-starter-kit.com/source','/1/p8Xb0pjW7kouSxPb6UiLMvZPvXZzy57c.jpg');

/*Table structure for table `article_attachment` */

DROP TABLE IF EXISTS `article_attachment`;

CREATE TABLE `article_attachment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `article_id` int(11) NOT NULL,
  `path` varchar(255) NOT NULL,
  `base_url` varchar(255) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `size` int(11) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `created_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_article_attachment_article` (`article_id`),
  CONSTRAINT `fk_article_attachment_article` FOREIGN KEY (`article_id`) REFERENCES `article` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

