insert  into `product`(`product_id`,`title`,`slug`,`description`,`product_type`,`product_cate`,`city`,`district`,`ward`,`street`,`lng`,`lat`,`project_id`,`area`,`price`,`price_type`,`address`,`facade`,`entry_width`,`direction`,`balcony_direction`,`floor_number`,`room_number`,`toilet_number`,`interior`,`ct_name`,`ct_address`,`ct_phone`,`ct_mobile`,`ct_email`,`approved`,`author_id`,`start_date`,`end_date`,`published`,`deleted`,`created_at`,`updated_at`) values (1,'Cần bán gấp CH Intracom Trung Văn căn 06 tầng 9, dt 75.8m2, ban công ĐN, giá 20tr/m2 (bao phí)','can-ban-gap-ch-intracom-trung-van-can-06-tang-9-dt-758m2-ban-cong-n-gia-20trm2-bao-phi','Gia đình tôi có căn hộ ở chung cư Intracom muốn bán gấp để lây tiền mua nhà diện tích lớn hơn. Căn 06 tầng 9. Diện tích 75.8m2. 2PN, 2VS. Ban công ĐN. Thoáng mát. Nội thất cơ bản. Tôi đang rất thiện chí bán ai có nhu cầu tôi thương lượng nhiệt tình. Gặp trực tiếp chủ nhà. ĐT 0936453638',1,1,2,2,59,70,'105.82277581831056','21.031824973975713',1051,100,20,4,'2 Dự án Chung cư cao cấp 15 – 17 Ngọc Khánh, Ba Đình, Hà Nội',20,20,2,2,4,5,5,'','','',NULL,1686003570,'',1,NULL,1430415420,1433007480,0,0,1430651170,1430997296),(2,'HOT - CĂN HỘ TIÊU CHUẨN HÀN QUỐC, NGAY Q.2 CHO THUÊ ĐẦY ĐỦ TIỆN NGHI','hot-can-ho-tieu-chuan-han-quoc-ngay-q2-cho-thue-ay-u-tien-nghi','Diện tích 59m2, 79m2, 96m2, 104m2, 110m2 1 phòng ngủ, 2 phòng ngủ và 3 phòng ngủ.\r\nGiá thuê từ 7.57 triệu/tháng.\r\nDự án có xe đưa đón khách hàng hằng ngày đi Quận 1 (Diamond), Quận 2 (Parkson, Metro, Cantavil), Phú Mỹ Hưng Quận 7.\r\nDự án đã có nhà sẵn và đang được các chuyên gia Samsung, Nhật Bản và khách Châu Âu thuê ở đây, môi trường văn minh cao cấp với hồ bơi, sân tennis, nhà hàng Hàn Quốc, sân tập golf, coffe shop, nhà giữ trẻ tiêu chuẩn Hàn Quốc.\r\nLiên hệ: Phòng kinh doanh 0906 18 68 78.',2,4,1,54,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Quận 2, Hồ Chí Minh',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','Dự án Intracom1, Nam Từ Liêm, Hà Nôi',1686003570,1686003570,'',0,NULL,1430848500,1432922100,0,0,1430848564,1430848564);

